import styled from 'styled-components';

const Layout = styled.div`
  width: 100%;
  height: 100%;
  background: pink;
  display: flex;
  justify-content: space-evenly;
  align-items: center;
`;

const Header = () => {
  return (
    <Layout>
      <h1>로고</h1>
      <h1>WELCOME HOME</h1>
      <h1>MYPAGE</h1>
    </Layout>
  );
};

export default Header;
